import React, {Component} from 'react';

class App extends Component {
    render() {
        window.navigator.geolocation.getCurrentPosition(
            position => console.log(position),
            err=>console.log(err)
        );
        return (
            <div>
                
            </div>
        );
    }
}

export default App;
